import React, { useState, useEffect } from 'react';
import {
  Grid,
  Card,
  CardContent,
  Typography,
  Box,
  Chip,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  CircularProgress,
  Button,
  Alert,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  IconButton,
} from '@mui/material';
import { dashboardService, testSuiteService, testExecutionService } from '../../services/apiService';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
  PieChart,
  Pie,
  Cell,
  BarChart,
  Bar
} from 'recharts';
import {
  TrendingUp as TrendingUpIcon,
  TrendingDown as TrendingDownIcon,
  CheckCircle as CheckCircleIcon,
  PlayArrow as PlayArrowIcon,
  Code as CodeIcon,
  Assessment as AssessmentIcon,
  MergeType as GitMergeIcon,
  AutoAwesome as AutoAwesomeIcon,
  Close as CloseIcon,
  Visibility as VisibilityIcon,
} from '@mui/icons-material';

// Chart colors
const CHART_COLORS = ['#1976d2', '#dc004e', '#9c27b0', '#2e7d32', '#ed6c02'];

const StatCard: React.FC<{
  title: string;
  value: string | number;
  change?: number;
  icon: React.ReactNode;
  color: string;
  clickable?: boolean;
  onClick?: () => void;
}> = ({ title, value, change, icon, color, clickable = false, onClick }) => (
  <Card 
    sx={{ 
      height: '100%',
      cursor: clickable ? 'pointer' : 'default',
      transition: 'all 0.2s ease-in-out',
      '&:hover': clickable ? {
        transform: 'translateY(-4px)',
        boxShadow: 4,
      } : {}
    }}
    onClick={clickable ? onClick : undefined}
  >
    <CardContent>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
        <Box>
          <Typography color="textSecondary" gutterBottom variant="overline">
            {title}
          </Typography>
          <Typography variant="h4" sx={{ color }}>
            {value}
          </Typography>
          {change !== undefined && (
            <Box sx={{ display: 'flex', alignItems: 'center', mt: 1 }}>
              {change >= 0 ? (
                <TrendingUpIcon sx={{ color: 'success.main', mr: 0.5 }} fontSize="small" />
              ) : (
                <TrendingDownIcon sx={{ color: 'error.main', mr: 0.5 }} fontSize="small" />
              )}
              <Typography variant="body2" color={change >= 0 ? 'success.main' : 'error.main'}>
                {Math.abs(change)}%
              </Typography>
            </Box>
          )}
        </Box>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          {icon}
          {clickable && <VisibilityIcon sx={{ fontSize: 20, color: 'text.secondary' }} />}
        </Box>
      </Box>
    </CardContent>
  </Card>
);

const Dashboard: React.FC = () => {
  const [dashboardData, setDashboardData] = useState<any>(null);
  const [testSuites, setTestSuites] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [dataSource, setDataSource] = useState<'api' | 'fallback'>('api');
  const [testDetailsOpen, setTestDetailsOpen] = useState(false);
  const [runningTestsOpen, setRunningTestsOpen] = useState(false);
  const [executingTests, setExecutingTests] = useState(false);
  const [runningTestSuites, setRunningTestSuites] = useState<any[]>([]);
  const [detailedTestCasesOpen, setDetailedTestCasesOpen] = useState(false);
  const [detailedTestCases, setDetailedTestCases] = useState<any[]>([]);
  const [testCaseStatus, setTestCaseStatus] = useState<string>('');
  const [loadingTestCases, setLoadingTestCases] = useState(false);

  // Function to execute tests for entire codebase
  const executeCodebaseTests = async () => {
    try {
      setExecutingTests(true);
      console.log('ðŸ§ª Starting codebase-wide test execution...');
      console.log('ðŸ“Š Test suites to execute:', testSuites);

      // Mark all test suites as running
      const runningSuites = testSuites.map(suite => ({
        ...suite,
        status: 'RUNNING',
        startedAt: new Date().toISOString()
      }));
      setRunningTestSuites(runningSuites);
      console.log('ðŸƒâ€â™‚ï¸ Marked test suites as running:', runningSuites);

      // Execute tests for all test suites
      const executionPromises = testSuites.map(async (suite, index) => {
        try {
          console.log(`ðŸš€ Executing test suite ${suite.id} (${suite.name})...`);
          const result = await testExecutionService.start(suite.id);
          console.log(`âœ… Test suite ${suite.id} execution started:`, result);
          return result;
        } catch (error) {
          console.error(`âŒ Failed to execute test suite ${suite.id}:`, error);
          throw error;
        }
      });

      // Wait for all executions to complete
      const results = await Promise.all(executionPromises);
      console.log('ðŸŽ‰ All test executions completed:', results);

      // Simulate longer test execution time (1-2 minutes)
      await new Promise(resolve => setTimeout(resolve, 90000)); // 90 seconds

      // Clear running suites after execution
      setRunningTestSuites([]);

      // Refresh dashboard data
      await fetchDashboardData();

      console.log('âœ… Codebase test execution completed');
    } catch (error) {
      console.error('âŒ Failed to execute codebase tests:', error);
      setError('Failed to execute codebase tests: ' + (error as Error).message);
      setRunningTestSuites([]);
    } finally {
      setExecutingTests(false);
    }
  };

  // Helper function to calculate test type distribution
  const getTestTypeDistribution = () => {
    const typeCount: { [key: string]: number } = {};
    (testSuites || []).forEach(suite => {
      typeCount[suite.type] = (typeCount[suite.type] || 0) + 1;
    });

    return Object.entries(typeCount).map(([type, count], index) => ({
      name: type,
      value: count,
      color: CHART_COLORS[index % CHART_COLORS.length]
    }));
  };

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      console.log('ðŸš€ Fetching dashboard data...');
      console.log('ðŸ”‘ Token in localStorage:', !!localStorage.getItem('token'));

      // Fetch dashboard stats and test suites in parallel
      const [statsResponse, suitesResponse] = await Promise.all([
        dashboardService.getStats(),
        testSuiteService.getAll()
      ]);

      console.log('ðŸ“Š Stats response:', statsResponse);
      console.log('ðŸ“ Suites response:', suitesResponse);

      if (statsResponse && statsResponse.success) {
        setDashboardData(statsResponse.data);
        setDataSource('api');
        console.log('âœ… Dashboard data set from API:', statsResponse.data);
      } else {
        console.warn('âš ï¸ Stats response not successful:', statsResponse);
      }

      if (suitesResponse && suitesResponse.success) {
        setTestSuites(suitesResponse.data);
        setDataSource('api');
        console.log('âœ… Test suites set from API:', suitesResponse.data);
      } else {
        console.warn('âš ï¸ Suites response not successful:', suitesResponse);
      }

      // If no data was loaded, set fallback data for demonstration
      if (!statsResponse?.success && !suitesResponse?.success) {
        console.log('ðŸ“Š Using fallback data for demonstration');
        setDashboardData({
          totalTests: 176,
          passedTests: 161,
          failedTests: 8,
          coverage: 91.5,
          executionTime: 245,
          activePRs: 2,
          mergedPRs: 1,
          generatedTestSuites: 6,
          runningTests: 0,
          trendsData: [
            { date: '2024-01-01', passed: 120, failed: 5, coverage: 75.0, prs: 0 },
            { date: '2024-01-02', passed: 135, failed: 7, coverage: 76.0, prs: 1 },
            { date: '2024-01-03', passed: 161, failed: 8, coverage: 91.5, prs: 2 }
          ],
          recentPRs: [
            { id: 1, number: 123, title: 'Add user validation service', status: 'OPEN', testsGenerated: 8, passRate: '87.5' },
            { id: 2, number: 124, title: 'Update authentication flow', status: 'MERGED', testsGenerated: 12, passRate: '100.0' }
          ]
        });
        setTestSuites([
          { id: 1, name: 'User Service Tests', type: 'UNIT', status: 'COMPLETED', coverage: 95, testCases: [{ name: 'testUserCreation' }, { name: 'testUserValidation' }] },
          { id: 2, name: 'Payment Integration Tests', type: 'INTEGRATION', status: 'COMPLETED', coverage: 88, testCases: [{ name: 'testPaymentProcessing' }] },
          { id: 3, name: 'API Endpoint Tests', type: 'E2E', status: 'RUNNING', coverage: 92, testCases: [{ name: 'testUserAPI' }, { name: 'testPaymentAPI' }] }
        ]);
        setDataSource('fallback');
      }
    } catch (error) {
      console.error('âŒ Error fetching dashboard data:', error);
      setError('Failed to load dashboard data');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchDashboardData();
  }, []);

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '200px' }}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Box sx={{ p: 3 }}>
        <Typography color="error">{error}</Typography>
        <Button onClick={() => window.location.reload()}>Retry</Button>
      </Box>
    );
  }

  // Calculate additional stats from real data
  const passRate = dashboardData ? 
    ((dashboardData.passedTests / (dashboardData.passedTests + dashboardData.failedTests)) * 100).toFixed(1) : '0';

  // Calculate rounded coverage percentage
  const coveragePercentage = dashboardData ? 
    Math.round(dashboardData.coverage || 0) : 0;

  const runningTests = (testSuites || []).filter(suite => suite.status === 'RUNNING').length;

  const handleRetry = () => {
    setError(null);
    setDataSource('api');
    window.location.reload(); // Simple retry by reloading
  };

  // Function to fetch detailed test cases by status
  const fetchDetailedTestCases = async (status: string) => {
    try {
      setLoadingTestCases(true);
      setTestCaseStatus(status);
      console.log('ðŸ” Fetching detailed test cases for status:', status);

      const response = await testExecutionService.getDetailedTestCaseResults(status);
      console.log('ðŸ“Š Detailed test cases response:', response);

      if (response && response.success) {
        setDetailedTestCases(response.data || []);
        setDetailedTestCasesOpen(true);
        console.log('âœ… Loaded detailed test cases:', response.data?.length || 0);
      } else {
        console.warn('âš ï¸ No detailed test cases found for status:', status);
        setDetailedTestCases([]);
        setDetailedTestCasesOpen(true);
      }
    } catch (error) {
      console.error('âŒ Error fetching detailed test cases:', error);
      setError('Failed to fetch detailed test cases: ' + (error as Error).message);
    } finally {
      setLoadingTestCases(false);
    }
  };

  return (
    <Box sx={{ p: 3 }}>
      {/* Header */}
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Typography variant="h4" component="h1">
          Dashboard
        </Typography>
        <Chip 
          label={dataSource === 'api' ? 'Live API Data' : 'Demo Data'} 
          color={dataSource === 'api' ? 'success' : 'default'}
          variant="outlined"
        />
      </Box>

      {/* Main Metrics Row */}
      <Grid container spacing={3} sx={{ mb: 3 }}>
        <Grid item xs={12} sm={6} lg={3}>
          <StatCard
            title="Total Tests"
            value={dashboardData?.totalTests?.toLocaleString() || '0'}
            change={12}
            icon={<CodeIcon sx={{ fontSize: 40 }} />}
            color="#1976d2"
            clickable={true}
            onClick={() => setTestDetailsOpen(true)}
          />
        </Grid>
        <Grid item xs={12} sm={6} lg={3}>
          <StatCard
            title="Pass Rate"
            value={`${passRate}%`}
            change={2.1}
            icon={<CheckCircleIcon sx={{ fontSize: 40 }} />}
            color="#2e7d32"
            clickable={true}
            onClick={() => fetchDetailedTestCases('PASSED')}
          />
        </Grid>
        <Grid item xs={12} sm={6} lg={3}>
          <StatCard
            title="Failed Tests"
            value={dashboardData?.failedTests || 0}
            icon={<CheckCircleIcon sx={{ fontSize: 40 }} />}
            color="#d32f2f"
            clickable={true}
            onClick={() => fetchDetailedTestCases('FAILED')}
          />
        </Grid>
        <Grid item xs={12} sm={6} lg={3}>
          <StatCard
            title="Running Tests"
            value={runningTestSuites.length}
            icon={<PlayArrowIcon sx={{ fontSize: 40 }} />}
            color="#9c27b0"
            clickable={true}
            onClick={() => setRunningTestsOpen(true)}
          />
        </Grid>
      </Grid>

      {/* PR Metrics Row */}
      <Grid container spacing={3} sx={{ mb: 3 }}>
        <Grid item xs={12} sm={6} lg={3}>
          <StatCard
            title="Active PRs"
            value={dashboardData?.activePRs || 0}
            icon={<GitMergeIcon sx={{ fontSize: 40 }} />}
            color="#1976d2"
          />
        </Grid>
        <Grid item xs={12} sm={6} lg={3}>
          <StatCard
            title="Merged PRs"
            value={dashboardData?.mergedPRs || 0}
            icon={<CheckCircleIcon sx={{ fontSize: 40 }} />}
            color="#2e7d32"
          />
        </Grid>
        <Grid item xs={12} sm={6} lg={3}>
          <StatCard
            title="Test Suites Generated"
            value={dashboardData?.generatedTestSuites || 0}
            icon={<AutoAwesomeIcon sx={{ fontSize: 40 }} />}
            color="#ed6c02"
          />
        </Grid>
        <Grid item xs={12} sm={6} lg={3}>
          <StatCard
            title="Coverage"
            value={`${coveragePercentage}%`}
            icon={<AssessmentIcon sx={{ fontSize: 40 }} />}
            color="#9c27b0"
          />
        </Grid>
      </Grid>

      {/* Charts Row */}
      <Grid container spacing={3} sx={{ mb: 3 }}>
        <Grid item xs={12} lg={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Test Execution Trends
              </Typography>
              <Box sx={{ height: 320, p: 2 }}>
                <ResponsiveContainer width="100%" height="100%">
                  <LineChart data={dashboardData?.trendsData || []}>
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="date" />
                    <YAxis />
                    <Tooltip />
                    <Legend />
                    <Line 
                      type="monotone" 
                      dataKey="passed" 
                      stroke="#2e7d32" 
                      strokeWidth={3}
                      name="Passed Tests"
                      dot={{ r: 4 }}
                    />
                    <Line 
                      type="monotone" 
                      dataKey="failed" 
                      stroke="#d32f2f" 
                      strokeWidth={3}
                      name="Failed Tests"
                      dot={{ r: 4 }}
                    />
                    <Line 
                      type="monotone" 
                      dataKey="coverage" 
                      stroke="#1976d2" 
                      strokeWidth={3}
                      name="Coverage %"
                      dot={{ r: 4 }}
                    />
                  </LineChart>
                </ResponsiveContainer>
              </Box>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} lg={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Test Suite Distribution
              </Typography>
              <Box sx={{ height: 320, p: 2 }}>
                <ResponsiveContainer width="100%" height="100%">
                  <PieChart>
                    <Pie
                      data={testSuites?.slice(0, 4).map((suite: any, index: number) => ({
                        name: suite.name ? suite.name.substring(0, 12) : `Suite ${suite.id}`,
                        value: suite.testCount || 1,
                        status: suite.status || 'READY',
                        tests: suite.testCount || 1
                      })) || []}
                      cx="50%"
                      cy="50%"
                      labelLine={false}
                      label={false}
                      outerRadius={70}
                      fill="#8884d8"
                      dataKey="value"
                    >
                      {testSuites?.slice(0, 4).map((entry: any, index: number) => {
                        const colors = ['#2196f3', '#4caf50', '#ff9800', '#f44336'];
                        return <Cell key={`cell-${index}`} fill={colors[index % colors.length]} />;
                      })}
                    </Pie>
                    <Tooltip 
                      formatter={(value: any, name: any, props: any) => [
                        `${value} tests`, 
                        props.payload.name
                      ]}
                    />
                    <Legend 
                      verticalAlign="bottom" 
                      height={80}
                      formatter={(value: any) => value}
                      wrapperStyle={{ fontSize: '11px', padding: '5px' }}
                      layout="horizontal"
                    />
                  </PieChart>
                </ResponsiveContainer>
              </Box>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Test Results Overview */}
      <Grid container spacing={3} sx={{ mb: 3 }}>
        <Grid item xs={12}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Test Results Overview
              </Typography>
              <Box sx={{ height: 320, p: 2 }}>
                <ResponsiveContainer width="100%" height="100%">
                  <BarChart data={[
                    { name: 'Total', value: dashboardData?.totalTests || 0, fill: '#1976d2' },
                    { name: 'Passed', value: dashboardData?.passedTests || 0, fill: '#2e7d32' },
                    { name: 'Failed', value: dashboardData?.failedTests || 0, fill: '#d32f2f' },
                    { name: 'Suites', value: dashboardData?.generatedTestSuites || 0, fill: '#ed6c02' }
                  ]}>
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip />
                    <Bar dataKey="value" />
                  </BarChart>
                </ResponsiveContainer>
              </Box>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Recent PRs */}
      {dashboardData?.recentPRs && dashboardData.recentPRs.length > 0 && (
        <Card sx={{ mb: 3 }}>
          <CardContent>
            <Typography variant="h6" gutterBottom>
              Recent Pull Requests
            </Typography>
            <List>
              {dashboardData.recentPRs.map((pr: any) => (
                <ListItem key={pr.id}>
                  <ListItemIcon>
                    <GitMergeIcon />
                  </ListItemIcon>
                  <ListItemText
                    primary={`PR #${pr.number}: ${pr.title}`}
                    secondary={`Status: ${pr.status} | Tests: ${pr.testsGenerated} | Pass Rate: ${pr.passRate}%`}
                  />
                </ListItem>
              ))}
            </List>
          </CardContent>
        </Card>
      )}

      {/* Test Details Dialog */}
      <Dialog
        open={testDetailsOpen}
        onClose={() => setTestDetailsOpen(false)}
        maxWidth="lg"
        fullWidth
        PaperProps={{
          sx: { 
            minHeight: '70vh',
            maxHeight: '90vh'
          }
        }}
      >
        <DialogTitle>
          <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
            <Typography variant="h6">
              Test Details - {dashboardData?.totalTests || 0} Total Tests
            </Typography>
            <IconButton onClick={() => setTestDetailsOpen(false)}>
              <CloseIcon />
            </IconButton>
          </Box>
        </DialogTitle>
        <DialogContent>
          <Box sx={{ mb: 3 }}>
            <Grid container spacing={2}>
              <Grid item xs={3}>
                <Card sx={{ textAlign: 'center', p: 2 }}>
                  <Typography variant="h4" color="primary.main">
                    {dashboardData?.totalTests || 0}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Total
                  </Typography>
                </Card>
              </Grid>
              <Grid item xs={3}>
                <Card sx={{ textAlign: 'center', p: 2 }}>
                  <Typography variant="h4" color="success.main">
                    {dashboardData?.passedTests || 0}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Passed
                  </Typography>
                </Card>
              </Grid>
              <Grid item xs={3}>
                <Card sx={{ textAlign: 'center', p: 2 }}>
                  <Typography variant="h4" color="error.main">
                    {dashboardData?.failedTests || 0}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Failed
                  </Typography>
                </Card>
              </Grid>
              <Grid item xs={3}>
                <Card sx={{ textAlign: 'center', p: 2 }}>
                  <Typography variant="h4" color="warning.main">
                    {dashboardData?.runningTests || 0}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Running
                  </Typography>
                </Card>
              </Grid>
            </Grid>
          </Box>

          <Typography variant="h6" sx={{ mb: 2 }}>
            Test Suites ({testSuites.length})
          </Typography>

          <TableContainer component={Paper} sx={{ maxHeight: 400 }}>
            <Table stickyHeader>
              <TableHead>
                <TableRow>
                  <TableCell>Suite Name</TableCell>
                  <TableCell>Type</TableCell>
                  <TableCell>Status</TableCell>
                  <TableCell>Tests</TableCell>
                  <TableCell>Coverage</TableCell>
                  <TableCell>Last Run</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {testSuites.map((suite) => (
                  <TableRow key={suite.id}>
                    <TableCell>
                      <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                        <AssessmentIcon 
                          color={suite.status === 'COMPLETED' ? 'success' : 
                                 suite.status === 'RUNNING' ? 'primary' : 'action'} 
                        />
                        <Typography variant="body2" fontWeight="medium">
                          {suite.name}
                        </Typography>
                      </Box>
                    </TableCell>
                    <TableCell>
                      <Chip 
                        label={suite.type} 
                        size="small" 
                        color={suite.type === 'UNIT' ? 'primary' : 
                               suite.type === 'INTEGRATION' ? 'secondary' : 'default'}
                      />
                    </TableCell>
                    <TableCell>
                      <Chip
                        size="small"
                        label={suite.status}
                        color={suite.status === 'COMPLETED' ? 'success' : 
                               suite.status === 'RUNNING' ? 'primary' : 'default'}
                        variant="outlined"
                      />
                    </TableCell>
                    <TableCell>
                      <Typography variant="body2">
                        {suite.testCases?.length || 0} tests
                      </Typography>
                    </TableCell>
                    <TableCell>
                      <Typography variant="body2">
                        {suite.coverage}%
                      </Typography>
                    </TableCell>
                    <TableCell>
                      <Typography variant="body2" color="text.secondary">
                        {suite.lastRun ? new Date(suite.lastRun).toLocaleDateString() : 'Never'}
                      </Typography>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>

          {testSuites.length === 0 && (
            <Box sx={{ textAlign: 'center', py: 4 }}>
              <AssessmentIcon sx={{ fontSize: 64, color: 'text.secondary', mb: 2 }} />
              <Typography variant="h6" color="text.secondary">
                No test suites found
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Generate some tests to see them here
              </Typography>
            </Box>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setTestDetailsOpen(false)}>
            Close
          </Button>
        </DialogActions>
      </Dialog>

      {/* Running Tests Dialog */}
      <Dialog
        open={runningTestsOpen}
        onClose={() => setRunningTestsOpen(false)}
        maxWidth="lg"
        fullWidth
        PaperProps={{
          sx: { 
            minHeight: '70vh',
            maxHeight: '90vh'
          }
        }}
      >
        <DialogTitle>
          <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
            <Typography variant="h6">
              Running Tests & Codebase Execution
            </Typography>
            <IconButton onClick={() => setRunningTestsOpen(false)}>
              <CloseIcon />
            </IconButton>
          </Box>
        </DialogTitle>
        <DialogContent>
          <Box sx={{ mb: 3 }}>
            <Grid container spacing={2}>
              <Grid item xs={3}>
                <Card sx={{ textAlign: 'center', p: 2 }}>
                  <Typography variant="h4" color="primary.main">
                    {runningTestSuites.length}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Currently Running
                  </Typography>
                </Card>
              </Grid>
              <Grid item xs={3}>
                <Card sx={{ textAlign: 'center', p: 2 }}>
                  <Typography variant="h4" color="success.main">
                    {dashboardData?.passedTests || 0}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Passed
                  </Typography>
                </Card>
              </Grid>
              <Grid item xs={3}>
                <Card sx={{ textAlign: 'center', p: 2 }}>
                  <Typography variant="h4" color="error.main">
                    {dashboardData?.failedTests || 0}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Failed
                  </Typography>
                </Card>
              </Grid>
              <Grid item xs={3}>
                <Card sx={{ textAlign: 'center', p: 2 }}>
                  <Typography variant="h4" color="warning.main">
                    {testSuites.length}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Total Suites
                  </Typography>
                </Card>
              </Grid>
            </Grid>
          </Box>

          <Box sx={{ mb: 3 }}>
            <Typography variant="h6" sx={{ mb: 2 }}>
              Execute Tests for Entire Codebase
            </Typography>
            <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
              Run all test suites across your entire codebase to ensure comprehensive coverage.
            </Typography>
            <Button
              variant="contained"
              color="primary"
              size="large"
              startIcon={executingTests ? <CircularProgress size={20} /> : <PlayArrowIcon />}
              onClick={executeCodebaseTests}
              disabled={executingTests}
              sx={{ mb: 2 }}
            >
              {executingTests ? 'Executing Tests... (1-2 min)' : 'Run All Tests'}
            </Button>
            {executingTests && (
              <Alert severity="info" sx={{ mt: 2 }}>
                Running tests across all {testSuites.length} test suites. This may take a few minutes...
              </Alert>
            )}
          </Box>

          <Typography variant="h6" sx={{ mb: 2 }}>
            Currently Running Test Suites
          </Typography>

          {runningTestSuites.length > 0 && (
            <Alert severity="info" sx={{ mb: 2 }}>
              {runningTestSuites.length} test suites are currently running. This may take 1-2 minutes to complete.
            </Alert>
          )}

          <TableContainer component={Paper} sx={{ maxHeight: 400 }}>
            <Table stickyHeader>
              <TableHead>
                <TableRow>
                  <TableCell>Suite Name</TableCell>
                  <TableCell>Type</TableCell>
                  <TableCell>Status</TableCell>
                  <TableCell>Progress</TableCell>
                  <TableCell>Coverage</TableCell>
                  <TableCell>Started</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {runningTestSuites.map((suite) => (
                  <TableRow key={suite.id}>
                    <TableCell>
                      <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                        <PlayArrowIcon color="primary" />
                        <Typography variant="body2" fontWeight="medium">
                          {suite.name}
                        </Typography>
                      </Box>
                    </TableCell>
                    <TableCell>
                      <Chip 
                        label={suite.type} 
                        size="small" 
                        color={suite.type === 'UNIT' ? 'primary' : 
                               suite.type === 'INTEGRATION' ? 'secondary' : 'default'}
                      />
                    </TableCell>
                    <TableCell>
                      <Chip
                        size="small"
                        label="RUNNING"
                        color="primary"
                        variant="outlined"
                      />
                    </TableCell>
                    <TableCell>
                      <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                        <CircularProgress size={16} />
                        <Typography variant="body2">
                          In Progress
                        </Typography>
                      </Box>
                    </TableCell>
                    <TableCell>
                      <Typography variant="body2">
                        {suite.coverage}%
                      </Typography>
                    </TableCell>
                    <TableCell>
                      <Typography variant="body2" color="text.secondary">
                        {suite.startedAt ? new Date(suite.startedAt).toLocaleTimeString() : 'Just now'}
                      </Typography>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>

          {runningTestSuites.length === 0 && (
            <Box sx={{ textAlign: 'center', py: 4 }}>
              <PlayArrowIcon sx={{ fontSize: 64, color: 'text.secondary', mb: 2 }} />
              <Typography variant="h6" color="text.secondary">
                No tests currently running
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Click "Run All Tests" to execute tests across your entire codebase
              </Typography>
            </Box>
          )}

          {/* Completed Test Cases Section */}
          <Box sx={{ mt: 4 }}>
            <Typography variant="h6" sx={{ mb: 2 }}>
              Recently Completed Test Cases
            </Typography>

            <TableContainer component={Paper} sx={{ maxHeight: 300 }}>
              <Table stickyHeader>
                <TableHead>
                  <TableRow>
                    <TableCell>Test Case</TableCell>
                    <TableCell>Suite</TableCell>
                    <TableCell>Status</TableCell>
                    <TableCell>Duration</TableCell>
                    <TableCell>Completed</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {testSuites.slice(0, 5).map((suite) => (
                    <TableRow key={suite.id}>
                      <TableCell>
                        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                          <CheckCircleIcon color="success" />
                          <Typography variant="body2" fontWeight="medium">
                            {suite.name} Test Cases
                          </Typography>
                        </Box>
                      </TableCell>
                      <TableCell>
                        <Chip 
                          label={suite.type} 
                          size="small" 
                          color={suite.type === 'UNIT' ? 'primary' : 
                                 suite.type === 'INTEGRATION' ? 'secondary' : 'default'}
                        />
                      </TableCell>
                      <TableCell>
                        <Chip
                          size="small"
                          label="COMPLETED"
                          color="success"
                          variant="outlined"
                        />
                      </TableCell>
                      <TableCell>
                        <Typography variant="body2">
                          {Math.floor(Math.random() * 30) + 10}s
                        </Typography>
                      </TableCell>
                      <TableCell>
                        <Typography variant="body2" color="text.secondary">
                          {new Date().toLocaleTimeString()}
                        </Typography>
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setRunningTestsOpen(false)}>
            Close
          </Button>
        </DialogActions>
      </Dialog>

      {/* Detailed Test Cases Dialog */}
      <Dialog
        open={detailedTestCasesOpen}
        onClose={() => setDetailedTestCasesOpen(false)}
        maxWidth="lg"
        fullWidth
        PaperProps={{
          sx: { 
            minHeight: '70vh',
            maxHeight: '90vh'
          }
        }}
      >
        <DialogTitle>
          <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
            <Typography variant="h6">
              {testCaseStatus === 'PASSED' ? 'Passed Test Cases' : 
               testCaseStatus === 'FAILED' ? 'Failed Test Cases' : 
               'All Test Cases'} ({detailedTestCases.length})
            </Typography>
            <IconButton onClick={() => setDetailedTestCasesOpen(false)}>
              <CloseIcon />
            </IconButton>
          </Box>
        </DialogTitle>
        <DialogContent>
          {loadingTestCases ? (
            <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', py: 4 }}>
              <CircularProgress />
              <Typography sx={{ ml: 2 }}>Loading test cases...</Typography>
            </Box>
          ) : detailedTestCases.length > 0 ? (
            <TableContainer component={Paper} sx={{ maxHeight: 500 }}>
              <Table stickyHeader>
                <TableHead>
                  <TableRow>
                    <TableCell>Test Case</TableCell>
                    <TableCell>Suite</TableCell>
                    <TableCell>Type</TableCell>
                    <TableCell>Status</TableCell>
                    <TableCell>Priority</TableCell>
                    <TableCell>Execution Time</TableCell>
                    <TableCell>Executed At</TableCell>
                    <TableCell>Error Message</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {detailedTestCases.map((testCase) => (
                    <TableRow key={testCase.id}>
                      <TableCell>
                        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                          <CheckCircleIcon 
                            color={testCase.status === 'PASSED' ? 'success' : 
                                   testCase.status === 'FAILED' ? 'error' : 'action'} 
                          />
                          <Box>
                            <Typography variant="body2" fontWeight="medium">
                              {testCase.name}
                            </Typography>
                            {testCase.description && (
                              <Typography variant="caption" color="text.secondary">
                                {testCase.description}
                              </Typography>
                            )}
                          </Box>
                        </Box>
                      </TableCell>
                      <TableCell>
                        <Typography variant="body2">
                          {testCase.suiteName}
                        </Typography>
                      </TableCell>
                      <TableCell>
                        <Chip 
                          label={testCase.type} 
                          size="small" 
                          color={testCase.type === 'UNIT' ? 'primary' : 
                                 testCase.type === 'INTEGRATION' ? 'secondary' : 'default'}
                        />
                      </TableCell>
                      <TableCell>
                        <Chip
                          size="small"
                          label={testCase.status}
                          color={testCase.status === 'PASSED' ? 'success' : 
                                 testCase.status === 'FAILED' ? 'error' : 'default'}
                          variant="outlined"
                        />
                      </TableCell>
                      <TableCell>
                        <Chip
                          size="small"
                          label={testCase.priority}
                          color={testCase.priority === 'HIGH' ? 'error' : 
                                 testCase.priority === 'MEDIUM' ? 'warning' : 'default'}
                          variant="outlined"
                        />
                      </TableCell>
                      <TableCell>
                        <Typography variant="body2">
                          {testCase.executionTime ? `${testCase.executionTime}ms` : 'N/A'}
                        </Typography>
                      </TableCell>
                      <TableCell>
                        <Typography variant="body2" color="text.secondary">
                          {testCase.executedAt ? new Date(testCase.executedAt).toLocaleString() : 'Never'}
                        </Typography>
                      </TableCell>
                      <TableCell>
                        {testCase.errorMessage ? (
                          <Typography variant="body2" color="error.main" sx={{ maxWidth: 200, overflow: 'hidden', textOverflow: 'ellipsis' }}>
                            {testCase.errorMessage}
                          </Typography>
                        ) : (
                          <Typography variant="body2" color="text.secondary">
                            No errors
                          </Typography>
                        )}
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          ) : (
            <Box sx={{ textAlign: 'center', py: 4 }}>
              <CheckCircleIcon sx={{ fontSize: 64, color: 'text.secondary', mb: 2 }} />
              <Typography variant="h6" color="text.secondary">
                No {testCaseStatus.toLowerCase()} test cases found
              </Typography>
              <Typography variant="body2" color="text.secondary">
                {testCaseStatus === 'PASSED' ? 'All tests are failing or pending' : 
                 testCaseStatus === 'FAILED' ? 'All tests are passing or pending' : 
                 'No test cases available'}
              </Typography>
            </Box>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDetailedTestCasesOpen(false)}>
            Close
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default Dashboard;
